import React from 'react'
import { useFetch } from '../hooks/useFetch'

const Blog = () => {

    const { data, error, loading } = useFetch('https://jsonplaceholder.typicode.com/posts')

    if(loading){
        return <h2>loading...</h2>
    }

    if(error !== ''){
        return <h2>{error}</h2>
    }

    return (
        <div>
            <h1>Blog</h1>
            {
                data.map(item => (
                    <h4 key={item.id}> 
                        <link>

                        </link> 
                    </h4>
                ))
            }
        </div>
    )
}

export default Blog
